import React from "react";

function AddTodo({ taskText, setTaskText, addTask }) {
  return (
    <div>
      <input
        type="text"
        placeholder="Add New"
        value={taskText}
        onChange={(e) => setTaskText(e.target.value)}
      />
      <button onClick={addTask}>Add</button>
    </div>
  );
}

export default AddTodo;
